import { Container, Row, Col } from 'reactstrap';
import "./style.css"

function ImgCard(props){
    return(
        <Container>
      <Row xs="2">
        <Col>      <div>
            <img className="image-cards" src ={props.image} alt="imageCard" onClick={()=> props.handleImageClick(props.id)}></img>
        </div>
    )
}</Col>
      </Row>

    </Container>
  );
}

export default ImgCard;
